        border: 0,
        borderRadius: 2,
        borderTopRightRadius: 0,
        borderBottomRightRadius: 0,
        fontSize: 18,
        padding: 15,
        height: 30,
        width: 300,
    },
    searchInputs: {
        display: "flex",
    },
    dataResults: {

    },
    searchIcon: {
        height: 60,
        width: 50,
        backgroundColor: 'white',
